import React from "react";
import Typography from "@material-ui/core/Typography";
import { makeStyles } from "@material-ui/core/styles";
import Link from "@material-ui/core/Link";

function CopyRight() {
    return (
        <Typography style={{ color : '#fff' }} variant="body2" color="textSecondary" align="center">
            {"Copyright © "}
            <Link color="inherit" href="" style={{ color : '#fff' }}>
                herbify.com
            </Link>{" "}
            {new Date().getFullYear()}
            {"."}
        </Typography>
    );
}

const useStyles = makeStyles((theme) => ({
    footer: {
      backgroundColor: theme.palette.background.paper,
      padding: theme.spacing(6),
    },
  }));
  
  export default function Footer() {
    const classes = useStyles();
    return (
      //className={classes.footer}
      <footer style={{ background: '#38b000' }}>
        <Typography variant="h6" align="center" gutterBottom style={{ color : '#fff' }}>
          Herbify Herble Mart
        </Typography>
        <Typography
          variant="subtitle1"
          align="center"
          color="textSecondary"
          component="p"
          style={{ color : '#fff' }}
        >
          100% organic products 
        </Typography>
        <CopyRight />
      </footer>
    );
  }
